import React from 'react';
import styled from 'styled-components';
import { FaBolt, FaTwitter, FaGithub, FaLinkedin } from 'react-icons/fa';

const FooterBar = styled.footer`
  width: 100%;
  background: rgba(10, 20, 40, 0.98);
  border-top: 1px solid #223;
  margin-top: 40px;
  display: flex;
  flex-direction: column;
  align-items: center;
  box-shadow: 0 -2px 16px rgba(0,0,0,0.08);
`;

const FooterMain = styled.div`
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1.2fr 1fr 1.2fr;
  gap: 48px;
  align-items: start;
  padding: 48px 32px 24px 32px;
  box-sizing: border-box;
  position: relative;

  @media (max-width: 900px) {
    grid-template-columns: 1fr;
    gap: 32px;
    padding: 32px 12px 16px 12px;
    text-align: center;
  }
`;

const Divider = styled.div`
  width: 1px;
  background: rgba(180, 234, 255, 0.08);
  height: 100%;
  margin: 0 0;
  @media (max-width: 900px) {
    display: none;
  }
`;

const Brand = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  gap: 12px;
  min-width: 220px;
  @media (max-width: 900px) {
    align-items: center;
    margin-bottom: 0;
  }
`;

const BrandRow = styled.div`
  display: flex;
  align-items: center;
  gap: 14px;
`;

const BrandIcon = styled.div`
  color: #4CAF50;
  font-size: 2.2rem;
`;

const BrandName = styled.div`
  font-size: 1.7rem;
  font-weight: 800;
  color: #fff;
  letter-spacing: 1px;
`;

const Tagline = styled.div`
  color: #b0eaff;
  font-size: 1.08rem;
  font-weight: 500;
`;

const Description = styled.div`
  color: #b0b8c7;
  font-size: 1rem;
  max-width: 340px;
  margin-top: 4px;
`;

const Links = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  gap: 10px;
  min-width: 180px;
  @media (max-width: 900px) {
    align-items: center;
  }
`;

const LinkTitle = styled.div`
  color: #b0eaff;
  font-weight: 700;
  margin-bottom: 10px;
  font-size: 1.1rem;
`;

const FooterLink = styled.a`
  color: #b0eaff;
  text-decoration: none;
  font-size: 1.02rem;
  transition: color 0.2s;
  &:hover {
    color: #fff;
    text-decoration: underline;
  }
`;

const Contact = styled.div`
  color: #ccc;
  font-size: 1.02rem;
  line-height: 1.8;
  min-width: 220px;
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  @media (max-width: 900px) {
    align-items: center;
    margin-top: 0;
  }
`;

const ContactTitle = styled.div`
  font-weight: 700;
  color: #b0eaff;
  margin-bottom: 10px;
  font-size: 1.1rem;
`;

const Socials = styled.div`
  display: flex;
  gap: 18px;
  margin-top: 12px;
`;

const SocialIcon = styled.a`
  color: #b0eaff;
  font-size: 1.4rem;
  transition: color 0.2s;
  &:hover {
    color: #4CAF50;
  }
`;

const Copyright = styled.div`
  color: #888;
  font-size: 14px;
  text-align: center;
  width: 100%;
  padding-bottom: 16px;
`;

const Footer = () => {
  return (
    <FooterBar>
      <FooterMain>
        <Brand>
          <BrandRow>
            <BrandIcon><FaBolt /></BrandIcon>
            <BrandName>CloneCraft</BrandName>
          </BrandRow>
          <Tagline>Lightning-fast website resource scraper</Tagline>
          <Description>
            CloneCraft helps you archive, analyze, and download entire websites with their original folder structure. Perfect for developers, designers, and researchers.
          </Description>
        </Brand>
        <Divider />
        <Links>
          <LinkTitle>Links</LinkTitle>
          <FooterLink href="#">Home</FooterLink>
          <FooterLink href="#">Features</FooterLink>
          <FooterLink href="#">Pricing</FooterLink>
          <FooterLink href="#">Docs</FooterLink>
          <FooterLink href="#">Blog</FooterLink>
          <FooterLink href="#">Support</FooterLink>
          <FooterLink href="#">Terms</FooterLink>
          <FooterLink href="#">Privacy</FooterLink>
        </Links>
        <Divider />
        <Contact>
          <ContactTitle>Contact</ContactTitle>
          <div>Email: <a href="mailto:support@clonecraft.com" style={{color:'#b0eaff'}}>support@clonecraft.com</a></div>
          <div>Phone: <a href="tel:+1234567890" style={{color:'#b0eaff'}}>+1 (234) 567-890</a></div>
          <Socials>
            <SocialIcon href="#" title="Twitter" target="_blank" rel="noopener noreferrer"><FaTwitter /></SocialIcon>
            <SocialIcon href="#" title="GitHub" target="_blank" rel="noopener noreferrer"><FaGithub /></SocialIcon>
            <SocialIcon href="#" title="LinkedIn" target="_blank" rel="noopener noreferrer"><FaLinkedin /></SocialIcon>
          </Socials>
        </Contact>
      </FooterMain>
      <Copyright>
        &copy; {new Date().getFullYear()} CloneCraft. All rights reserved.
      </Copyright>
    </FooterBar>
  );
};

export default Footer;
